import React from "react";
import "../pages/Home.css";
import Header from "../components/header/Header";
import qr from "../assets/images/qr.png"


const Home = () => {
  return (
      <div className="page">
        <Header/>
        <div className="content">
          <img src={qr} alt="qr" height="400px"/>
        </div>
        </div>
  );
};

export default Home;
